export function PartnerLogoWall() {
  return (
    <div className={clsxm('grid relative grid-cols-2 md:grid-cols-3 gap-2 lg:gap-5 mb-6 overflow-hidden')}>
      <svg className='pointer-events-none absolute inset-0 [z-index:-1] size-full select-none text-(--grid-border-color) py-[1px] opacity-60'>
        <defs>
          <pattern id='gutter-s1' width='4' height='4' patternUnits='userSpaceOnUse' patternTransform='rotate(45)'>
            <line x1='0' y1='0' x2='0' y2='4' stroke='currentColor' strokeWidth='1.5' />
          </pattern>
        </defs>
        <rect width='100%' height='100%' fill='url(#gutter-s1)'></rect>
      </svg>
      {partners.map((partner) => (
        <div
          key={partner.ariaLabel}
          className='flex relative items-center justify-center p-4 before:absolute before:top-0 before:h-px before:w-[200vw] before:-left-[100vw] before:bg-(--grid-border-color) after:absolute after:bottom-0 after:h-px after:w-[200vw] after:-right-[100vw] after:bg-(--grid-border-color)'
          aria-label={partner.ariaLabel}
        >
          <div className='absolute inset-0 before:absolute before:left-0 before:w-px before:h-[200vh] before:-top-[100vh] before:bg-(--grid-border-color) after:absolute after:right-0 after:w-px after:h-[200vh] after:-bottom-[100vh] after:bg-(--grid-border-color)' />
          <div className='flex items-center justify-center text-neutral-600 dark:text-neutral-300 h-5 lg:h-5.5'>
            {partner.svg}
          </div>
        </div>
      ))}
    </div>
  )
}
